scene.onOverlapTile(SpriteKind.Player, assets.tile`myTile65`, function (sprite, location) {
    tiles.placeOnRandomTile(sprite, assets.tile`myTile66`)
    sprite.setFlag(SpriteFlag.GhostThroughTiles, true)
    timer.after(2000, function () {
        sprite.setFlag(SpriteFlag.GhostThroughTiles, false)
    })
})
function UPD_HAT_POS (Selected: Sprite, Target: Sprite) {
    Selected.x = Target.x
    Selected.y = Target.y - 10
    timer.after(5, function () {
        if (!(spriteutils.isDestroyed(Target))) {
            UPD_HAT_POS(Selected, Target)
        }
    })
}
sprites.onOverlap(SpriteKind.P1HandSelector, SpriteKind.PlayerBox, function (sprite, otherSprite) {
    if (controller.A.isPressed()) {
        animation.runImageAnimation(
        P1REFLECTCHARACTERIMAGE,
        AnimationIdleRight[sprites.readDataNumber(otherSprite, "ID")],
        200,
        true
        )
        TextForP1.setText(Names[sprites.readDataNumber(otherSprite, "ID")])
        Player1Character = sprites.readDataNumber(otherSprite, "ID")
        if (Selected < MaximumPlayers) {
            P1READY = true
        }
    }
})
function SetSpriteDamage (Selected: Sprite, Value: number) {
    sprites.setDataNumber(Selected, "Damage", Value)
}
sprites.onOverlap(SpriteKind.P2Projectile, SpriteKind.Player, function (sprite, otherSprite) {
    sprites.destroy(sprite)
    if (sprites.readDataBoolean(otherSprite, "CanBeHit")) {
        ToggleSpriteCanBeHit(otherSprite, false)
        scene.cameraShake(4, 500)
        otherSprite.vy += 0 - (sprites.readDataNumber(otherSprite, "HP") + sprites.readDataNumber(sprite, "Damage") / 2)
        otherSprite.vx = sprites.readDataNumber(sprite, "Dir") * 2
        characterAnimations.setCharacterAnimationsEnabled(otherSprite, false)
        otherSprite.setFlag(SpriteFlag.GhostThroughSprites, true)
        ToggleSpriteAttacking(otherSprite, false)
        SetSpriteHP(otherSprite, sprites.readDataNumber(sprite, "Damage") + sprites.readDataNumber(otherSprite, "HP"))
        animation.runImageAnimation(
        otherSprite,
        HitAnimations[Player1Character],
        100,
        false
        )
        timer.after(300, function () {
            ToggleSpriteCanBeHit(otherSprite, true)
        })
        pauseUntil(() => otherSprite.isHittingTile(CollisionDirection.Bottom))
        characterAnimations.setCharacterAnimationsEnabled(otherSprite, true)
        if (sprites.readDataBoolean(sprite, "Burn")) {
            otherSprite.startEffect(effects.fire, 5000)
            sprites.setDataBoolean(otherSprite, "OnFire", true)
            for (let index = 0; index < randint(5, 13); index++) {
                SetSpriteHP(otherSprite, sprites.readDataNumber(otherSprite, "HP") + 1)
                pause(1000)
            }
            sprites.setDataBoolean(otherSprite, "OnFire", false)
        }
        timer.after(300, function () {
            otherSprite.setFlag(SpriteFlag.GhostThroughSprites, false)
        })
    }
})
sprites.onOverlap(SpriteKind.Enemy, SpriteKind.Trap, function (sprite, otherSprite) {
    if (sprites.readDataBoolean(sprite, "CanBeHit")) {
        sprites.destroy(otherSprite)
        scene.cameraShake(4, 500)
        characterAnimations.setCharacterAnimationsEnabled(sprite, false)
        sprite.vy += -65
        ToggleSpriteCanBeHit(sprite, false)
        ToggleSpriteAttacking(sprite, false)
        SetSpriteHP(sprite, sprites.readDataNumber(sprite, "HP") + 15)
        animation.runImageAnimation(
        sprite,
        HitAnimations[Player2Character],
        100,
        false
        )
        pauseUntil(() => sprite.isHittingTile(CollisionDirection.Bottom))
        characterAnimations.setCharacterAnimationsEnabled(sprite, true)
        timer.after(1000, function () {
            sprite.vx = 0
            ToggleSpriteCanBeHit(sprite, true)
        })
    }
})
