sprites.onCreated(SpriteKind.PlayerBox, function (sprite) {
    sprites.setDataNumber(sprite, "ID", AllBoxes)
    AllBoxes += 1
    X += 17
    SpritesInARow += 1
    if (SpritesInARow == 10) {
        X = 12
        Y += 20
        SpritesInARow = 1
    }
    sprite.x = X
    sprite.y = Y
})
scene.onOverlapTile(SpriteKind.Enemy, assets.tile`myTile31`, function (sprite, location) {
    if (sprites.readDataNumber(sprite, "HP") < MaxHealth) {
        SetSpriteHP(sprite, MaxHealth)
    }
})
function Change () {
    P1REFLECTCHARACTERIMAGE.y += 40
    P1REFLECTCHARACTERIMAGE.x += -45
    console.log("changed")
}
sprites.onCreated(SpriteKind.MapShower, function (sprite) {
    Maps.push(sprite)
    sprites.setDataNumber(sprite, "ID", AllBoxes)
    AllBoxes += 1
    X += 32
    SpritesInARow += 1
    if (SpritesInARow == 6) {
        SpritesInARow = 0
        X = 51
        Y += 50
    }
    sprite.x = X - 34
    sprite.y = Y
})
sprites.onCreated(SpriteKind.Trap, function (sprite) {
    timer.after(30000, function () {
        sprites.destroy(sprite)
    })
})
controller.B.onEvent(ControllerButtonEvent.Pressed, function () {
    if (SelectingCharacter) {
        MaximumPlayers = 0
        SelectingCharacter = false
        AllBoxes = 0
        sprites.destroyAllSpritesOfKind(SpriteKind.PlayerBox)
        sprites.destroyAllSpritesOfKind(SpriteKind.Selector)
        sprites.destroyAllSpritesOfKind(SpriteKind.Text)
        sprites.destroyAllSpritesOfKind(SpriteKind.P2HandSelector)
        sprites.destroyAllSpritesOfKind(SpriteKind.P1HandSelector)
        sprites.destroyAllSpritesOfKind(SpriteKind.ImageShower)
        sprites.destroyAllSpritesOfKind(SpriteKind.ButtonBattle)
        sprites.destroyAllSpritesOfKind(SpriteKind.Button)
        FadeToWhiteWithPause(1000, false)
        StartGameMenu()
    } else if (SelectOption) {
        AllBoxes = 0
        sprites.destroyAllSpritesOfKind(SpriteKind.Box)
        sprites.destroyAllSpritesOfKind(SpriteKind.Selector)
        sprites.destroyAllSpritesOfKind(SpriteKind.Text)
        FadeToWhiteWithPause(1000, false)
        SelectOption = false
        GameBootUp()
    } else if (SelectingMap) {
        sprites.destroyAllSpritesOfKind(SpriteKind.MapShower)
        sprites.destroyAllSpritesOfKind(SpriteKind.Selector)
        sprites.destroyAllSpritesOfKind(SpriteKind.Text)
        FadeToWhiteWithPause(1000, false)
        SelectingMap = false
        StartCharacters(Multiplayer, RankedBattle)
    } else if (InBattle) {
        DoSpecialButtonMoves(mySprite, Player1Character, controller.left.isPressed(), controller.right.isPressed(), controller.up.isPressed(), 0)
    }
})
sprites.onOverlap(SpriteKind.Player, SpriteKind.Bounce, function (sprite, otherSprite) {
    sprite.vy += -200
    sprite.setFlag(SpriteFlag.GhostThroughSprites, true)
    timer.after(500, function () {
        sprite.setFlag(SpriteFlag.GhostThroughSprites, false)
    })
})
sprites.onOverlap(SpriteKind.Player, SpriteKind.FallingThing, function (sprite, otherSprite) {
    sprites.destroy(otherSprite)
    scene.cameraShake(4, 500)
    characterAnimations.setCharacterAnimationsEnabled(sprite, false)
    sprite.vy += -65
    ToggleSpriteCanBeHit(sprite, false)
    ToggleSpriteAttacking(sprite, false)
    SetSpriteHP(sprite, sprites.readDataNumber(sprite, "HP") + 25)
    animation.runImageAnimation(
    sprite,
    HitAnimations[Player1Character],
    100,
    false
    )
    sprite.setFlag(SpriteFlag.GhostThroughSprites, true)
    pauseUntil(() => sprite.isHittingTile(CollisionDirection.Bottom))
    characterAnimations.setCharacterAnimationsEnabled(sprite, true)
    sprite.vx = 0
    sprite.setFlag(SpriteFlag.GhostThroughSprites, false)
    ToggleSpriteCanBeHit(sprite, true)
})
