function LoadCharacterAnimations (IdleRight: any[], IdleLeft: any[], RunningRight: any[], RunningLeft: any[], Sprite2: Sprite) {
    characterAnimations.loopFrames(
    Sprite2,
    IdleRight,
    100,
    characterAnimations.rule(Predicate.NotMoving, Predicate.FacingRight)
    )
    characterAnimations.loopFrames(
    Sprite2,
    IdleLeft,
    100,
    characterAnimations.rule(Predicate.NotMoving, Predicate.FacingLeft)
    )
    characterAnimations.loopFrames(
    Sprite2,
    RunningRight,
    100,
    characterAnimations.rule(Predicate.MovingRight)
    )
    characterAnimations.loopFrames(
    Sprite2,
    RunningLeft,
    100,
    characterAnimations.rule(Predicate.MovingLeft)
    )
}
controller.right.onEvent(ControllerButtonEvent.Pressed, function () {
    if (SelectOption) {
        if (CurrentSelection < Boxes.length - 1) {
            CurrentSelection += 1
        }
    } else if (SelectingMap) {
        if (MapSelection < Maps.length - 1) {
            MapSelection += 1
            MapSelectArrow.x = Maps[MapSelection].x
        }
    } else if (SelectGamemode) {
        if (ModeSelection < GamemodeSelect.length - 1) {
            ModeSelection += 1
            GamemodeSelectArrow.x = GamemodeSelect[ModeSelection].x
        }
    }
})
