function Dodge (Selected: Sprite, ID: number, GetPlayer: number) {
    if (!(sprites.readDataBoolean(Selected, "Dodge"))) {
        if (!(sprites.readDataBoolean(Selected, "Attacking"))) {
            characterAnimations.setCharacterAnimationsEnabled(Selected, false)
            sprites.setDataBoolean(Selected, "Dodge", true)
            sprites.setDataBoolean(Selected, "CanAttack", false)
            sprites.setDataBoolean(Selected, "CanBeHit", false)
            if (GetPlayer == 0) {
                controller.moveSprite(Selected, 0, 0)
            } else if (GetPlayer == 1) {
                if (Multiplayer) {
                    controller.player2.moveSprite(Selected, 0, 0)
                }
            }
            animation.runImageAnimation(
            Selected,
            DodgeAnims[ID],
            100,
            false
            )
            Selected.setFlag(SpriteFlag.GhostThroughSprites, true)
            timer.after(600, function () {
                if (GetPlayer == 0) {
                    controller.moveSprite(Selected, SpeedStats[ID], 0)
                } else if (GetPlayer == 1) {
                    if (Multiplayer) {
                        controller.player2.moveSprite(Selected, SpeedStats[ID], 0)
                    }
                }
                Selected.setFlag(SpriteFlag.GhostThroughSprites, false)
                characterAnimations.setCharacterAnimationsEnabled(Selected, true)
                sprites.setDataBoolean(Selected, "CanAttack", true)
                sprites.setDataBoolean(Selected, "CanBeHit", true)
                timer.after(700, function () {
                    sprites.setDataBoolean(Selected, "Dodge", false)
                })
            })
        }
    }
}
